import React from 'react'

export default function ConversationsModal({ closeModal }) {
    return (
        <div>
            <h1>New Conversation</h1>
            <form>
                <h2>Contacts</h2>
                <button type="submit">Create</button>
            </form>
        </div>
    )
}
